import {
  Divider,
  Drawer,
  List,
  ListItem,
  ListItemIcon,
  Toolbar,
} from "@material-ui/core";
import React from "react";

const drawerWidth = 240;

function SideBar() {
  return (
    <>
      <Drawer
        sx={{
          width: drawerWidth,
          flexShrink: 0,
          "& .MuiDrawer-paper": {
            width: drawerWidth,
            boxSizing: "border-box",
          },
        }}
        variant="permanent"
        anchor="left"
      >
        <Toolbar />
        <Divider />
      </Drawer>
    </>
  );
}

export default SideBar;
